function initOfficeMap(){var e,o=document.getElementById("officeMap"),t=o.dataset,n={lat:Number(t.lat),lng:Number(t.lng)},m=Number(t.zoom);e=new google.maps.Map(o,{center:n,zoom:m});new google.maps.Marker({position:n,map:e});google.maps.event.addDomListener(window,"resize",function(){var o=document.documentElement.clientWidth;setTimeout(function(){e.setCenter(n),o<768?e.setZoom(m-2):e.setZoom(m)},500)})}